import './Doctor.css';
import React from 'react';
import { Players } from '../shared/ListOfDoctors';
import DocDetail from './DocDetail';
export default function Doctor() {
  return (
    <div className='doc'>
      <div className='container'>
        {Players.map((player) => (
          <div className='column'>
            <div className='card'>
              <img src={player.img} />
              <h3> {player.name} </h3>
              <p className='title'> {player.club} </p>
              <p><button className='btn'onClick={DocDetail} >Detail</button></p>
            </div>
          </div>
        ))}
      </div>
    </div>

  );
}
